import React, { useState } from "react";

import "./Reduce.css"

const Reduce = ()=>{
    const [num , setNum] = useState(0)
    return (
        <div className="data">
            <h1>{num}</h1>
            <button onClick={setNum()}>Like </button><br /><br />
            <button>UnLike</button><br /><br />
            <button>Comment</button><br /><br />
        </div>
    )
}

export default Reduce
